import React from 'react';
import Image from './Image';
import Exploring from './Exploring';
import InsightsTools from './InsightsTools';
import ExploreCardBuyExpanded from './ExploreCardBuyExpanded';

const Hero = () => {
  return (
    <>
    <Image/>
    <Exploring/>
    <InsightsTools/>
    <ExploreCardBuyExpanded/>
    </>
  )
}

export default Hero
